function updateRatings($pqInfo) {
	global $db;

	//Try to find it in the new database
	$newInfo = Mission::getByBasename($pqInfo["basename"]);

	//PQ:
	//Tutorial: 1000
	//Beginner: 1000
	//Intermediate: 2000
	//Advanced: 3000
	//Expert: 5000
	//Bonus: 4000

	$fields = "";
	foreach ($pqInfo as $field => $value) {
		if (array_key_exists($field, $newInfo->ratingInfo)) {
			$fields .= "`$field` = :$field,";
		}
	}
	$fields = substr($fields, 0, strlen($fields) - 1);

	$create = $db->prepare("INSERT IGNORE INTO `ex82r_mission_rating_info` SET
		`mission_id` = :mission_id,
		$fields
		ON DUPLICATE KEY UPDATE
		$fields
	");

	$create->bindValue(":mission_id", $newInfo->id);
	foreach ($pqInfo as $field => $value) {
		if (array_key_exists($field, $newInfo->ratingInfo)) {
			$create->bindValue(":$field", $pqInfo[$field]);
		}
	}
	$create->execute();
}

foreach ($ratingData as $info) {
	updateRatings($info);
